import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import Home from "./Pages/Home";
import Courses from "./Pages/Courses";
import Navbar from "./Components/Navbar";
import AddInfoToDatabase from "./Pages/AddInfoToDatabase";
import Registration from "./Pages/Registration";
import CourseDetail from "./Pages/CourseDetail";
import CourseList from "./Components/CourseList";

function App() {
  return (
    <Router>
      {/* This 'div' styles the sides of the webpage */}
      <div className="container">
        <Navbar />
        <br />
        {/* Route to Home */}
        <Route path="/" exact component={Home} />

        {/* Route to Courses */}
        <Route path="/courses" exact component={Courses} />

        {/* Route to Registration */}
        <Route path="/registration" exact component={Registration} />

        {/* Route to AddInfoToDatabase */}
        <Route path="/addinfo" exact component={AddInfoToDatabase} />

        {/* Route to Individual Course Detail  */}
        <Route path="/courses/:category/:id" component={CourseDetail} />

        {/* Router to list courses for each category */}
        <Route path="/courses/:category" exact component={CourseList} />
      </div>
    </Router>
  );
}

export default App;
